import "./App.css";
import Navbar from "./components/Navbar";
import "./components/Navbar.css";
// import Book from "./components/Book";

function App() {
  const BookList = [
    {
      title: "Respected Black Man",
      author: "Neslson Mandela",
      price: "Cheap as Cotton",
    },
    { title: "Game of thrones",
     author: "George RR martin", price: "55" },
  ];
  return (
    <div>
      <Navbar title="Something" />
      <BookList />
    </div>
  );
}

export default App;
